                   Zack Robin 
            </a>
            <a type="button" id='linkedin-btn' href='https://www.linkedin.com/in/zrobin88/' target='_blank'class="btn btn-outline-light btn-sm">Linkedin</a>
            <button type="button" class="btn btn-outline-light btn-sm" >Resume</button>
    </nav>
            )
        }

export default Nav
